import { useState } from "react";

const Hitter = ({ hitter }) => {
  const [modalIsOpen, setModalIsOpen] = useState(false);

  return (
    <>
      <tr>
        <td>{hitter.batArm}</td>
        <td>{hitter.name}</td>
        <td>{hitter.avg}</td>
        <td>{hitter.game}</td>
        <td>{hitter.atBat}</td>
        <td>{hitter.obp}</td>
        <td>{hitter.slg}</td>
        <td>{hitter.homerun}</td>
        {modalIsOpen && <div>hihihi</div>}
      </tr>
    </>
  );
};
export default Hitter;
